(95, 4, '2014-09-23 00:50:48', 'eBay Enterprise Display and Affiliate services can turbocharge your holiday sales. Learn how.', 'Learn more at www.ebayenterprise.com/turbochargesales.  DID YOU KNOW: Over 128 million shoppers visit eBay.com each month in Q4--and you can reach these highly qualified shoppers with eBay Enterprise Display. Also Magento merchants who use product-based retargeting ads average at least $5 in sales for every $1 in Retargeting spend. And on the Affiliate Network, you get access to over 200,000 active network publishers across 20+ promotional categories and 30+ verticals, and only pay when a consumer makes a purchase (Affiliate Network is only available in the U.S. & Canada). GET STARTED TODAY by visiting www.ebayenterprise.com/turbochargesales.', 'http://www.ebayenterprise.com/turbochargesales', 0, 0);

